	global bidenvotes
	global trumpdistricts
	global bidendistricts
	trumpvotes += (repblwo*blacks*0.45)
	bidenvotes += ((1-repblwo)*blacks*0.45)
	trumpvotes += (repblme*blacks*0.45)
	bidenvotes += ((1-repblme)*blacks*0.45)
