	bidenvotes += ((1-replawo)*hispanic*0.45)
	trumpvotes += (replame*hispanic*0.45)
	bidenvotes += ((1-replame)*hispanic*0.45)
	trumpvotes += (replaot*hispanic*0.1)
	bidenvotes += ((1-replaot)*hispanic*0.1)
